import PySimpleGUI as gui
import BinFilterOPT as BinFIlterLogic
import CoreDumpOPT as CoreDump
import sys

_C_POD_QC_ = b''

version = "1.0.0"


def mainWindow():
    layout = [
        [gui.Text("POD ID:",
                  background_color='white',
                  text_color='black'),
         gui.Text("--",
                  background_color='white',
                  text_color='green',
                  key='podid',
                  size=(16, 1))],
        [gui.Text("FACE:",
                  text_color='black',
                  background_color='white'),
         gui.Text("--",
                  key='face',
                  text_color='green',
                  background_color='white',
                  size=(9, 1)),
         gui.Text("BIN:",
                  text_color='black',
                  background_color='white'),
         gui.Text("--",
                  key="scanme",
                  text_color='green',
                  background_color='white',
                  size=(3, 1))],
        [gui.Multiline("",
                       visible=True,
                       key="textinput",
                       text_color='black',
                       background_color='white',
                       disabled=False,
                       size=(86, 10),
                       enable_events=True)],
        [gui.InputText("",
                       enable_events=False,
                       do_not_clear=False,
                       disabled=True,
                       text_color='black',
                       background_color='white',
                       key='maininput'),
         gui.Text("BIN ID:",
                  background_color='white',
                  text_color='black'),
         gui.Text(f"--",
                  text_color='green',
                  background_color='white',
                  key="binID",
                  size=(12, 1))],
        [gui.Button("Button",
                    bind_return_key=True,
                    visible=False,
                    key="Press",
                    enable_events=True,
                    disabled=True)],
        [gui.ProgressBar(max_value=1,
                         size=(56, 10),
                         bar_color=('green', 'lavender'),
                         visible=True,
                         key='passbar')],
        [gui.ProgressBar(max_value=1,
                         size=(56, 10),
                         bar_color=('red', 'lavender'),
                         visible=False,
                         key='failbar')]
    ]

    myWindow = gui.Window(f"PodQC {version}", layout=layout, background_color='white', icon=_C_POD_QC_)
    guiBinID = myWindow.find_element("binID")
    guiMultiLine = myWindow.find_element("textinput")
    guiBinLabel = myWindow.find_element("scanme")
    guiPodID = myWindow.find_element("podid")
    guiUserInput = myWindow.find_element("maininput")
    hiddenbutton = myWindow.find_element("Press")
    guiPodFace = myWindow.find_element('face')
    guiPassBar = myWindow.find_element('passbar')
    guiFailBar = myWindow.find_element('failbar')
    userArray = []
    while True:
        events, values = myWindow.Read()
        if events is None:
            myWindow.Close()
            sys.exit()
        if len(values['textinput']) > 13:
            guiUserInput.Update(disabled=False)
            hiddenbutton.Update(disabled=False)
        else:
            guiUserInput.Update(disabled=True)
            hiddenbutton.Update(disabled=True)
        if events == "Press" and values['maininput'] != '':
            guiMultiLine.Update(disabled=True)
            binList = BinFIlterLogic.splitToBin(values['textinput'])
            podIDTemp = BinFIlterLogic.getPodID(values['maininput'])
            while not bool(podIDTemp):
                extra, values = myWindow.Read()
                if extra is None:
                    myWindow.Close()
                    sys.exit()
                podIDTemp = BinFIlterLogic.getPodID(values['maininput'])
            guiBinID.Update(text_color='green')
            guiPodID.Update(text_color='green')
            guiPodFace.Update(text_color='green')
            guiBinLabel.Update(text_color='green')
            podID = BinFIlterLogic.stringOfElement(podIDTemp)
            guiPodID.Update(podID)
            faceArray = BinFIlterLogic.getFaces(binList)
            binsLetter = BinFIlterLogic.getBinLabels(binList)
            newList = BinFIlterLogic.getBinArray(binList)
            passValue = 0
            barMax = len(binsLetter)
            try:
                failed = False
                for i in range(len(binsLetter)):
                    if i == 0:
                        guiPassBar.Update(current_count=i, visible=True)
                        guiFailBar.Update(current_count=i, visible=False)
                    guiBinLabel.Update(binsLetter[i])
                    guiBinID.Update(newList[i])
                    guiPodFace.Update(faceArray[i])
                    while True:
                        temp, values = myWindow.Read()
                        if temp is None:
                            myWindow.Close()
                            sys.exit()
                        myWindow.Refresh()
                        userInputBin = BinFIlterLogic.userInputAsBin(values['maininput'])
                        if not bool(userInputBin):
                            pass
                        else:
                            userArray.append(userInputBin)
                            if newList[i] == BinFIlterLogic.stringOfElement(userInputBin) and not failed:
                                passValue += 1
                                guiPassBar.update_bar(passValue, max=barMax)
                                break
                            else:
                                failed = True
                                guiPassBar.Update(current_count=0, visible=False)
                                guiFailBar.Update(visible=True, current_count=barMax)
                                guiFailBar.update_bar(current_count=barMax, max=barMax)
                                guiBinID.Update(text_color='red')
                                guiPodID.Update(text_color='red')
                                guiPodFace.Update(text_color='red')
                                guiBinLabel.Update(text_color='red')
                                break
                guiMultiLine.Update(disabled=False)
                guiBinLabel.Update("--")
                guiPodFace.Update("--")
                guiBinID.Update("QC Passed") if not failed else guiBinID.Update("QC Failed", text_color='red')
                CoreDump.createRecipe(podID=podID, binFaces=faceArray, binLablels=binsLetter, binList=userArray)
                userArray = []
            except IndexError:
                pass


mainWindow()
